DROP DATABASE IF EXISTS pms;
CREATE DATABASE IF NOT EXISTS pms DEFAULT CHARACTER SET utf8 COLLATE utf8_general_ci;
USE pms;
SET NAMES 'utf8';
SET CHARACTER SET 'utf8';

CREATE TABLE IF NOT EXISTS OFFICES(
	office_code VARCHAR(6) NOT NULL,
	office_head VARCHAR(32) NOT NULL,
	office_name VARCHAR(100) NOT NULL,
	office_department VARCHAR(100) NOT NULL,
	CONSTRAINT office_code_pk PRIMARY KEY(office_code)
);

CREATE TABLE IF NOT EXISTS SUPPLIER(
	supplier_pk INT NOT NULL AUTO_INCREMENT,
	supplier_name VARCHAR(100) NOT NULL,
	supplier_address VARCHAR(100) NOT NULL,
	supplier_barangay VARCHAR(100) NOT NULL,
	supplier_contact_number VARCHAR(20) NOT NULL,
	supplier_proprietor VARCHAR(50) NOT NULL,
	supplier_nature VARCHAR(50) NOT NULL,
	CONSTRAINT supplier PRIMARY KEY(supplier_pk)
); 

CREATE TABLE IF NOT EXISTS ITEMS(
	item_code VARCHAR(20) NOT NULL,
	item_description VARCHAR(100) NOT NULL,
	item_unit_measure VARCHAR(10) NOT NULL,
	item_expenditure VARCHAR(50) NOT NULL,
	item_euc DOUBLE NOT NULL,
	CONSTRAINT item_code_pk PRIMARY KEY(item_code)
);

CREATE TABLE IF NOT EXISTS USERS(
	user_id varchar(20) not null,
	user_fname varchar(25)	not null,
	user_lname varchar(25) not null,
	user_position varchar(30) not null,
	username varchar(15) not null,
	password varchar(15) not null,
	CONSTRAINT user_id_pk PRIMARY KEY(user_id)
);

CREATE TABLE IF NOT EXISTS PURCHASE_REQUEST(
	pr_number INT NOT NULL AUTO_INCREMENT, 
	pr_year INT NOT NULL,
	pr_department VARCHAR(32) NOT NULL,
	pr_dev_section VARCHAR(32) NOT NULL,
	pr_purpose VARCHAR(100) NOT NULL,
	office_code VARCHAR(6) NOT NULL,
	pr_sai_number INT NULL,
	pr_sai_date DATE NULL,
	pr_obr_date DATE NULL,
	pr_date DATE NULL,
	pr_obr_number INT NULL,
	CONSTRAINT pr_number_pk PRIMARY KEY(pr_number),
	CONSTRAINT office_code_fk FOREIGN KEY(office_code) REFERENCES OFFICES(office_code)
);

CREATE TABLE IF NOT EXISTS PURCHASE_REQUEST_ITEMS(
	pr_items_id INT AUTO_INCREMENT NOT NULL,
	quantity INT NULL,
	item_code VARCHAR(20) NOT NULL,
	pr_number INT NOT NULL,
	pr_item_euc DOUBLE NOT NULL,
	CONSTRAINT pr_items_id PRIMARY KEY(pr_items_id),
	CONSTRAINT item_code_fk FOREIGN KEY(item_code) REFERENCES ITEMS(item_code),
	CONSTRAINT pr_number_fk_items FOREIGN KEY(pr_number) REFERENCES PURCHASE_REQUEST(pr_number)
);

CREATE TABLE IF NOT EXISTS PURCHASE_ORDER(
	po_number INT NOT NULL AUTO_INCREMENT,
	po_year YEAR NOT NULL,
	pr_number INT NOT NULL ,
	po_mode_of_procurement VARCHAR(50) NULL,
	po_place_of_delivery VARCHAR(100) NULL,
	po_date date NULL,
	po_delivery_term VARCHAR(50) NULL,
	po_payment_term VARCHAR(50) NULL,
	po_d_tracks VARCHAR(32) NULL,
	CONSTRAINT po_number_pk PRIMARY KEY(po_number),
	CONSTRAINT po_pr_number_fk FOREIGN KEY(pr_number) REFERENCES PURCHASE_REQUEST(pr_number)
);

CREATE TABLE IF NOT EXISTS PR_PO_STATUS(
	pr_po_status_id INT NOT NULL AUTO_INCREMENT,
	for_payment boolean,
	po_number INT NULL,
	pr_number INT NOT NULL,
	supplier_pk INT NULL,
	delivery_date date,
	delivered_date date,
	forwarded_date date,
	status VARCHAR(10),
	CONSTRAINT pr_po_status_id_pk PRIMARY KEY(pr_po_status_id),
	CONSTRAINT pr_po_po_number_fk FOREIGN KEY(po_number) REFERENCES PURCHASE_ORDER(po_number),
	CONSTRAINT po_supplier_pk_fk FOREIGN KEY(supplier_pk)  REFERENCES SUPPLIER(supplier_pk),
	CONSTRAINT pr_po_pr_number_fk FOREIGN KEY(pr_number) REFERENCES PURCHASE_REQUEST(pr_number)
);
